import styled from '@emotion/styled';
import { SimpleGrid } from '@chakra-ui/core';

const StyledItem = styled.li`
  width: 60%;
`;

const Item = (props) => {
  return (
    <li>
      <SimpleGrid columns="2">
        <span>{props.product}</span>
        <span>{props.quantity}</span>
      </SimpleGrid>
    </li>
  );
};

export default Item;
